import React from 'react';
import Body from '../Body/Body';
import Footer from '../Footer/Footer';
import Hero from '../Hero/Hero';
import Barra from '../Navbar/Navbar';

export const Inicio = () => {
  return (
  <div>
    <Barra/>
    <Hero/>
    <Body/>
    <Footer/>
  </div>
  );
};

export default Inicio;
